export const Header = () => {
    return (
    <>
    <header>
        <div className="links-layout">
            {swLinks.map((link) => (
            <a
                key={link.name}
                className="link"
                href={link.url}
                target="_blank"
                alt={link.name}
                rel="noreferrer"
            >
                {link.component}
            </a>
            ))}
        </div>
        <StarWarsLogoSVG />
        <div className="search-layout">
            <IconSearchSVG className="search-icon" />
            <input placeholder="Search Star Wars" type="text" />
            <div style={{ color: "white", paddingTop: "1rem" }}>I am fan of:</div>
        </div>
    </header>
    </>)
};
